import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Navbar from './components/Navbar'; 
import Footer from './components/Footer'; 
import BackToTopButton from './components/BackToTopButton'; 
import Homepage from './pages/Homepage/Homepage'; 
import About from './pages/About/About'; 
import Insights from './pages/Insights/Insights'; 
import Support from './pages/Support/Support'; 
import Contact from './pages/Contact/Contact'; 
import Community from './pages/Contact/Community/Community';
import Organization from './pages/Contact/Organization/Organization';
import Volunteer from './pages/Contact/Volunteer/Volunteer';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Navbar />
        <div className="content">
          <Routes>
            <Route path="/" element={<Homepage />} />
            <Route path="/about" element={<About />} />
            <Route path="/about/project" element={<div>About Project</div>} />
            <Route path="/about/me" element={<div>About Me</div>} />
            <Route path="/insights" element={<Insights />} />
            <Route path="/insights/history" element={<div>History</div>} />
            <Route path="/insights/experience" element={<div>Experience</div>} />
            <Route path="/insights/story" element={<div>Story</div>} />
            <Route path="/support" element={<Support />} />
            <Route path="/support/technology" element={<div>Technology</div>} />
            <Route path="/support/service" element={<div>Service</div>} />
            <Route path="/support/forum" element={<div>Forum</div>} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/contact/community" component={<Community />} />
            <Route path="/contact/organization" component={<Organization />} />
            <Route path="/contact/volunteer" component={<Volunteer />} />
          </Routes>
        </div>
        <BackToTopButton />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
